import React from "react";
import { Form, Button, Tabs, Tab, FloatingLabel, Row, Col, Alert } from "react-bootstrap";
import axios from "axios";
import { Apiurl } from "../services/apirest";
import { useNavigate } from "react-router-dom";

export function Login () {
    const navigate = useNavigate();
    const [form, setForm] = React.useState({
      username: "",
      password: ""
    });
    const [error, setError] = React.useState(false);
    const [errorMessage, setErrorMessage] = React.useState("");
    const [show, setShow] = React.useState(false);

    const handleClose = () => setShow(false);
    const handleShow = () => setShow(true);

    const handleChange = (e) => {
      const { form } = this.state;
      form[e.target.name] = e.target.value;
      this.setState({ form });
    }

    const handleSubmit = (e) => {
      e.preventDefault();
      let url = Apiurl + "/api/get_tokens"
      axios.post(url, this.state.form)
      .then(res => {
        if (res.status === 200) {
        localStorage.setItem("writ_etoken", res.data.write_token);
        localStorage.setItem("read_token", res.data.read_token);
        return navigate("/");
      }
      })
      .catch(err => {
        if (err.response) {
          this.setState({
            error: true,
            errorMessage: err.response.data
          })
        }
      })
    }

    return (
      <div className="container">
        <div className="row">
          <div className="col-md-4 offset-md-4">
            <h1 className="text-center">Login</h1>
            <Form onSubmit={this.handleSubmit}>
              <Form.Group controlId="formBasicEmail">
                <Form.Label>Username</Form.Label>
                <Form.Control
                  type="text"
                  name="username"
                  placeholder="Enter username"
                  onChange={this.handleChange}
                  value={this.state.form.username}
                />
              </Form.Group>
              <Form.Group controlId="formBasicPassword">
                <Form.Label>Password</Form.Label>
                <Form.Control
                  type="password"
                  name="password"
                  placeholder="Password"
                  onChange={this.handleChange}
                  value={this.state.form.password}
                />
              </Form.Group>
              <Button variant="primary" type="submit">
                Submit
              </Button>
            </Form>
            <Alert show={show} variant="danger" onClose={handleClose} dismissible>
              <Alert.Heading>Oh snap! You got an error!</Alert.Heading>
              <p>
                {errorMessage}
              </p>
            </Alert>
          </div>
        </div>
      </div>
    );
  }




